import React from 'react'
import { FormControl } from '@mui/base/FormControl';



function Admin() {
  return (
    <React.Fragment>
  <FormControl defaultValue="" required>
    <Label>Name</Label>
    <Input placeholder="Write your name here" className="CustomInput" />
    <HelperText />
  </FormControl>
  <Styles />
</React.Fragment>
  )
}

export default Admin
